var tipuesearch = {"pages": [{'title': 'MDE', 'text': '廖璟程40823124 (小胖好帥!) \n \n 副標題必須搭配中文 \n \n youtube github \n \n', 'tags': '', 'url': 'MDE.html'}, {'title': '課堂簡介', 'text': '紀錄每次課堂所學 \n', 'tags': '', 'url': '課堂簡介.html'}, {'title': '第一周', 'text': 'Cmsimde建立網站 \n 1.安裝隨身開發環境 full2020_cp.7z \n 2.安裝git套件 portableGit 放入data \n 3.修改start.bat內啟動路徑 \n \n 4.設定.gitconfig存放於home目錄    \n 5.建立github倉儲並clone至資料夾內 \n \n \n 6.將cmsimde架站器加入至cad2020目錄下 \n \n \n 7.將cmsimde中up_dir目錄下檔案全部移至cad2020目錄下 \n 8.安裝pip套件 :flask、flask_cors、lxml、bs4、pelican、markdown、leo   9.開啟wsgi.py 開始編輯近端網頁 \n \n', 'tags': '', 'url': '第一周.html'}, {'title': '第四周', 'text': '使用wlink \n nx介紹 \n \n', 'tags': '', 'url': '第四周.html'}, {'title': '第五周', 'text': 'What is API \n \n API是指應用程式介面，在網頁和程式中扮演介面和資料庫的橋樑，當點擊連結後將資料從資料庫中回傳至使用者介面中供使用者觀看。 \n', 'tags': '', 'url': '第五周.html'}, {'title': '第六周', 'text': '利用inventor內建API"iLogic"功能，使用基礎迴圈遞增多種尺寸以快速建立模型 \n \n 以c#編寫 \n //40823124編寫\n#include  \n#include  \n#include  \nint s=0;//形式 \nint i;\nint start = 1;\nint end;//遞增64次\nint L,W,H;//基礎長寬高 \nint l2,w2,h2;//增加值 \nint d3 = 0;\nint d12 =10;\nint main(void){\n\tprintf("輸入初始長度\\n");\n\t\tscanf("%d",&L);\n\tprintf("輸入初始寬度\\n");\n\t\tscanf("%d",&W);\n\tprintf("輸入初始高度\\n");\n\t\tscanf("%d",&H);\n\tprintf("輸入長度增值\\n");\n\t\tscanf("%d",&l2);\n\tprintf("輸入寬度增值\\n");\n\t\tscanf("%d",&w2);\n\tprintf("輸入高度增值\\n");\n\t\tscanf("%d",&h2);\n\tprintf("輸入遞增次數\\n");\n\t\tscanf("%d",&end);\n\t\tprintf("列印:\\n");\n  for(i=1;i <= end ;i++){ //使用迴圈遞增64次\n    L=L+l2;//每次增加\n    W=W+w2;//每次增加\n    H=H+h2;//每次增加\n    s=s+1;//每次增加\n    d3=d3+0;//不變\n    printf("If Style = %d Then \\n Leight = %d \\n Width = %d \\n Height = %d \\n d3 = %d \\n d11 = %d \\n volume = iProperties.Volume \\n Volume = volume \\n Parameter.UpdateAfterChange = True \\n End If \\n",s,L,W,H,d3,d12); //列印inventor可支援語言 \n  }\n  printf("點擊以結束\\n");\n  system("pause");\n  return 0;//返回\n  \n}\n \n', 'tags': '', 'url': '第六周.html'}, {'title': 'HomeWork', 'text': '每次課堂作業 \n', 'tags': '', 'url': 'HomeWork.html'}, {'title': '第1周', 'text': '體積試算表(小胖到此一遊) \n \n \n \n', 'tags': '', 'url': '第1周.html'}, {'title': '第4周', 'text': 'NX更新心得 \n \n NX12更新後統一稱為NX，不是NX13。  使用者UI有多種可更換  更加合適的解析度  取消 增強功能*  零組件可以設定密碼保護 \n', 'tags': '', 'url': '第4周.html'}, {'title': '程式', 'text': '', 'tags': '', 'url': '程式.html'}, {'title': 'inventor iLogic in Dart', 'text': '\n', 'tags': '', 'url': 'inventor iLogic in Dart.html'}, {'title': 'inventor in c#', 'text': 'C#編寫 \n //40823124編寫\n#include  \n#include  \n#include  \nint s=0;//形式 \nint i;\nint start = 1;\nint end;//遞增64次\nint L,W,H;//基礎長寬高 \nint l2,w2,h2;//增加值 \nint d3 = 0;\nint d12 =10;\nint main(void){\n\tprintf("輸入初始長度\\n");\n\t\tscanf("%d",&L);\n\tprintf("輸入初始寬度\\n");\n\t\tscanf("%d",&W);\n\tprintf("輸入初始高度\\n");\n\t\tscanf("%d",&H);\n\tprintf("輸入長度增值\\n");\n\t\tscanf("%d",&l2);\n\tprintf("輸入寬度增值\\n");\n\t\tscanf("%d",&w2);\n\tprintf("輸入高度增值\\n");\n\t\tscanf("%d",&h2);\n\tprintf("輸入遞增次數\\n");\n\t\tscanf("%d",&end);\n\t\tprintf("列印:\\n");\n  for(i=1;i <= end ;i++){ //使用迴圈遞增64次\n    L=L+l2;//每次增加\n    W=W+w2;//每次增加\n    H=H+h2;//每次增加\n    s=s+1;//每次增加\n    d3=d3+0;//不變\n    printf("If Style = %d Then \\n Leight = %d \\n Width = %d \\n Height = %d \\n d3 = %d \\n d11 = %d \\n volume = iProperties.Volume \\n Volume = volume \\n Parameter.UpdateAfterChange = True \\n End If \\n",s,L,W,H,d3,d12); //列印inventor可支援語言 \n  }\n  printf("點擊以結束\\n");\n  system("pause");\n  return 0;//返回\n  \n}\n \n \n 執行 \n \n', 'tags': '', 'url': 'inventor in c#.html'}, {'title': '小胖好帥', 'text': '', 'tags': '', 'url': '小胖好帥.html'}]};